import { React } from "react";
import "./styles.css";

const HomeOverview = () => {
  return (
    <>
      <div className="home-overview-container">
        <div className="overview-new-container">
          <div className="overview-new-header"></div>
          <div className="overview-new-content">
            <div className="overview-new-poster"></div>
          </div>
        </div>
      </div>
    </>
  );
};

export default HomeOverview;
